(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0a4499"],{"0696":function(n,o){n.exports='<h2 id="使用手册">使用手册</h2>\n<p>👏欢迎使用，vue-blog-template。</p>\n<h3 id="基本使用">基本使用</h3>\n<p>通过以下4个步骤👇，你就可以创建自己的博客啦。<strong>提个醒，所有的md文件都在/markdowns目录下哦</strong></p>\n<ol>\n<li>撰写自己的markdown文件，假设名字叫<strong>example.md</strong></li>\n<li>按照自己的喜好，把它归到某个文件夹下。例如我把这个<strong>example.md</strong>归档于 /markdowns/introduce 文件夹下，\n所以它对应的path地址就是 /introduce/example 啦</li>\n<li>编辑/markdowns/route.js文件，在markdownsComponent对象中增加相应函数</li>\n<li>编辑/nav/navList.js文件，在navList对象中增加对应地址</li>\n</ol>\n<p><strong>步骤3</strong></p>\n<p>例如下面这个范本，你只需把文件路径映射成对应的url名称，并使用驼峰命名成函数即可。</p>\n<pre><code class="language-js">const markdownsComponent = {\n  index: function () {\n    return import(&#39;@/markdowns/index.md&#39;)\n  },\n  introduceIndex: function () {\n    return import(&#39;@/markdowns/introduce/index.md&#39;)\n  },\n  introduceMarkdown: function () {\n    return import(&#39;@/markdowns/introduce/markdown.md&#39;)\n  },\n  introduceGuide: function () {\n    return import(&#39;@/markdowns/introduce/guide.md&#39;)\n  },\n  notFound () {\n    return import(&#39;@/markdowns/404.md&#39;)\n  }\n}\n</code></pre>\n<p><strong>步骤4</strong></p>\n<p>在nav文件下修改navList.js文件</p>\n<pre><code class="language-js">const navList = [\n  {\n    title: &#39;主页&#39;,\n    path: &#39;/index&#39;,\n    list: []\n  },\n  {\n    title: &#39;项目介绍&#39;,\n    path: &#39;/introduce&#39;,\n    list: [\n      { subtitle: &#39;使用手册&#39;, path: &#39;/introduce/guide&#39; },\n      { subtitle: &#39;项目原理&#39;, path: &#39;/introduce/markdown&#39; }\n    ]\n  }\n]\n</code></pre>\n<p>导航结构就是如此。暂时只有一级路径，后面这块内容还需要改进。。。</p>\n'}}]);
